"use strict";(self.webpackChunkAoiEngine=self.webpackChunkAoiEngine||[]).push([[86024],{84710:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"guidelines","metadata":{"permalink":"/wikis/guidelines","source":"@site/forums/guidelines.md","title":"Wiki Guidelines","description":"The official Wiki Guidelines.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[],"hasTruncateMarker":false,"authors":[{"name":"@faf4a","tags":["Community Manager","Staff"],"title":"Community Manager & Documentation Maintainer","url":"https://discord.com/users/428188716641812481","imageURL":"https://cdn.discordapp.com/avatars/428188716641812481/635c1dca728b68c2fa329dbcb3330204.png","key":"faf4a"}],"frontMatter":{"title":"Wiki Guidelines","description":"The official Wiki Guidelines.","slug":"guidelines","authors":"faf4a","hide_table_of_contents":false,"pagination_next":null,"pagination_prev":null},"nextItem":{"title":"Submit Wiki","permalink":"/wikis/submit"}},"content":"Welcome to the `aoi.js` Wiki! This document outlines the guidelines for contributing to the wiki content.\\n\\n## Purpose of Wikis\\n\\nThe `aoi.js` Wikis serve as a comprehensive resource for users to learn about the functionalities, features, and usage of the `aoi.js` package. It aims to provide clear and concise explanations, examples, and tutorials to help users make the most out of `aoi.js` in their projects.\\n\\n## Contribution Guidelines\\n\\nWe welcome contributions from the community to help improve and expand the `aoi.js` Wiki. To maintain a high-quality and consistent documentation, please adhere to the following guidelines when contributing:\\n\\n1. **Accuracy**: Ensure that the information provided in the Wiki is accurate, up-to-date, and relevant to the current version of `aoi.js`. If you are unsure about any information, consult the official `aoi.js` documentation or reach out to the maintainers.\\n\\n2. **Clarity**: Write in a clear and concise manner, using simple language to explain concepts. Avoid jargon and technical terms unless necessary, and provide explanations or definitions when using them.\\n\\n3. **Organization**: Structure the content logically and use appropriate headings, subheadings, and bullet points to make the information easy to navigate and understand. Consider adding examples, code snippets, and visuals where appropriate to enhance clarity.\\n\\n4. **Consistency**: Maintain consistency in formatting, styling, and terminology throughout the Wiki. Follow the existing conventions and style used in the documentation. If in doubt, refer to the style guide provided in the `aoi.js` repository.\\n\\n5. **Citation**: Whenever referencing external sources or quoting code, make sure to provide proper attribution and citation. Include links or references to the original sources, especially when explaining concepts or providing code examples from other projects.\\n\\n6. **Collaboration**: If you have suggestions, improvements, or corrections for existing content, feel free to open a pull request or create an issue on the `aoi.js` repository. Be respectful and constructive when engaging in discussions or providing feedback.\\n\\n## Conclusion\\n\\nBy following these guidelines, we can collectively create and maintain a valuable resource for the `aoi.js` community. Thank you for your contributions and helping others make the most out of `aoi.js`!\\n\\n:::info Ready to submit?\\n\\nHead to the [submittion Page](./introduction.md)!\\n\\n:::"},{"id":"submit","metadata":{"permalink":"/wikis/submit","source":"@site/forums/introduction.md","title":"Submit Wiki","description":"Submit a Wiki which will then be showcased on this website!","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[],"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Submit Wiki","description":"Submit a Wiki which will then be showcased on this website!","slug":"submit","hide_table_of_contents":false,"pagination_next":null,"pagination_prev":null},"prevItem":{"title":"Wiki Guidelines","permalink":"/wikis/guidelines"},"nextItem":{"title":"Random Country","permalink":"/wikis/posts/166181471369953280/p2o9s"}},"content":"Welcome to Wikis, this is still **experimental**.\\n\\n:::warning Before Submitting\\n\\nRead the guidelines or your Wiki will possibly get denied for not following the guidelines.\\n\\n:::\\n\\n\\n<div>\\n    <SubmitForm />\\n</div>"},{"id":"/posts/166181471369953280/p2o9s","metadata":{"permalink":"/wikis/posts/166181471369953280/p2o9s","source":"@site/forums/posts/166181471369953280/p2o9s.md","title":"Random Country","description":"A code for get information about a random code.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"},{"label":"v6","permalink":"/wikis/tags/v-6"}],"hasTruncateMarker":false,"authors":[{"name":"@jollyjolli","title":"Member - 166181471369953280","userid":"166181471369953280","url":"https://discord.com/users/166181471369953280","image_url":"https://cdn.discordapp.com/avatars/166181471369953280/153db0a862099b4f901d35849061898b.png","imageURL":"https://cdn.discordapp.com/avatars/166181471369953280/153db0a862099b4f901d35849061898b.png"}],"frontMatter":{"title":"Random Country","description":"A code for get information about a random code.","authors":{"name":"@jollyjolli","title":"Member - 166181471369953280","userid":"166181471369953280","url":"https://discord.com/users/166181471369953280","image_url":"https://cdn.discordapp.com/avatars/166181471369953280/153db0a862099b4f901d35849061898b.png","imageURL":"https://cdn.discordapp.com/avatars/166181471369953280/153db0a862099b4f901d35849061898b.png"},"tags":["aoi.js","v6"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Submit Wiki","permalink":"/wikis/submit"},"nextItem":{"title":"8ball command","permalink":"/wikis/posts/405070001356275712/2pf8fb"}},"content":"```js\\nmodule.exports = [{\\nname: \\"Random Country\\",\\naliases: [\\"rc\\"],\\ncode: `\\n$title[1;$getObjectProperty[countries[$random[0;250]].name_en]]\\n$addField[1;TLD;$getObjectProperty[countries[$random[0;250]].tld];true]\\n$addField[1;ISO Code (v2);$getObjectProperty[countries[$random[0;250]].code_3];true]\\n$addField[1;ISO Code (v1);$getObjectProperty[countries[$random[0;250]].code_2];true]\\n$addField[1;Capital;$getObjectProperty[countries[$random[0;250]].capital_es];true]\\n$addField[1;Dial Code;$getObjectProperty[countries[$random[0;250]].dial_code];true]\\n$addField[1;Continent;$getObjectProperty[countries[$random[0;250]].continent_en];true] \\n$image[1;https://flagcdn.com/w2560/$tolowercase[$getObjectProperty[countries[$random[0;250]].code_2]].jpg]\\n$footer[1;Code By $getObjectProperty[by]]\\n$color[$getUserVar[PFcolor]]\\n$createObject[$jsonRequest[https://www.jsonkeeper.com/b/L23E]]`\\n}];\\n```"},{"id":"/posts/405070001356275712/2pf8fb","metadata":{"permalink":"/wikis/posts/405070001356275712/2pf8fb","source":"@site/forums/posts/405070001356275712/2pf8fb.md","title":"8ball command","description":"8ball command","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@arkwell","title":"Member - 405070001356275712","userid":"405070001356275712","url":"https://discord.com/users/405070001356275712","image_url":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif","imageURL":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif"}],"frontMatter":{"title":"8ball command","description":"8ball command","authors":{"name":"@arkwell","title":"Member - 405070001356275712","userid":"405070001356275712","url":"https://discord.com/users/405070001356275712","image_url":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif","imageURL":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif"},"tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Random Country","permalink":"/wikis/posts/166181471369953280/p2o9s"},"nextItem":{"title":"Serverinfo command","permalink":"/wikis/posts/405070001356275712/6bdeo"}},"content":"```js\\nmodule.exports = [{\\n    name: \\"8ball\\",\\n    code: `$reply\\n    $randomText[Yes, definitely.;It is certain.;Without a doubt.;Most likely.;Outlook good.;Yes.;Signs point to yes.;Reply hazy, try again.;Ask again later.;Better not tell you now.;Cannot predict now.;Concentrate and ask again.;Don\'t count on it.;My reply is no.;My sources say no.;Outlook not so good.;Very doubtful.;It is decidedly so.;You may rely on it.;As I see it, yes.;It is known.;All signs point to yes.;The answer is unclear.;It\'s possible.;The stars say no.;It is not looking good.;It\'s a toss-up.;I wouldn\'t bet on it.;Doubtful at best.;Signs are pointing in your favor.;The outcome is uncertain.;Try asking again later.;You\'re better off not knowing.;Don\'t get your hopes up.;It\'s a long shot.;Chances are slim.;It\'s in the realm of possibility.;The signs are promising.;I\'m leaning towards yes.;It\'s a strong possibility.;Don\'t rely on it too much.;Keep your expectations low.;It\'s looking promising.;The odds are in your favor.;You might be pleasantly surprised.;It\'s worth a try.;Don\'t be too optimistic.;The future is uncertain.;It\'s up to you.;The answer lies within you.]\\n    $onlyIf[$message!=;Ask me a question.]\\n    `\\n}];\\n```"},{"id":"/posts/405070001356275712/6bdeo","metadata":{"permalink":"/wikis/posts/405070001356275712/6bdeo","source":"@site/forums/posts/405070001356275712/6bdeo.md","title":"Serverinfo command","description":"Requires GuildPresences in intents","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@arkwell","title":"Member - 405070001356275712","userid":"405070001356275712","url":"https://discord.com/users/405070001356275712","image_url":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif","imageURL":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif"}],"frontMatter":{"title":"Serverinfo command","description":"Requires GuildPresences in intents","authors":{"name":"@arkwell","title":"Member - 405070001356275712","userid":"405070001356275712","url":"https://discord.com/users/405070001356275712","image_url":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif","imageURL":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif"},"tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"8ball command","permalink":"/wikis/posts/405070001356275712/2pf8fb"},"nextItem":{"title":"Botinfo command","permalink":"/wikis/posts/405070001356275712/sr2wtw"}},"content":"```js\\nmodule.exports = [{\\n    name: \\"serverinfo\\",\\n    code: `\\n$addField[Channels;Total: $channelCount[$guildID]\\nText: $channelCount[$guildID;Text]\\nVoice: $channelCount[$guildID;Voice]\\nCategory: $channelCount[$guildID;Category]\\nNews: $channelCount[$guildID;Announcement]\\nThreads: $channelCount[$guildID;PublicThread]]\\n$addField[Emojis;Total: $emojiCount[$guildID]]\\n$addField[Roles;$roleCount[$guildID;true]]\\n$addField[Members;Total: $membersCount[$guildID]\\nHumans: $membersCount[$guildID;all;false]\\nBots: $sub[$membersCount[$guildID;all;true];$membersCount[$guildID;all;false]]\\nOnline: $membersCount[$guildID;online;true]]\\n$addField[Boosts;$guildBoostCount[$guildID] (Level $guildBoostLevel[$guildID])]\\n$addField[Creation;$creationDate[$guildID;time]]\\n$addField[Guild ID;$guildID]\\n$addField[Owner;<@$ownerID[$guildID]>]\\n$title[Server Information - $guildName[$guildID]]\\n  `\\n}]; \\n```\\n\\nRequires GuildPresences in intents"},{"id":"/posts/405070001356275712/sr2wtw","metadata":{"permalink":"/wikis/posts/405070001356275712/sr2wtw","source":"@site/forums/posts/405070001356275712/sr2wtw.md","title":"Botinfo command","description":"simple botinfo command","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@arkwell","title":"Member - 405070001356275712","userid":"405070001356275712","url":"https://discord.com/users/405070001356275712","image_url":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif","imageURL":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif"}],"frontMatter":{"title":"Botinfo command","description":"simple botinfo command","authors":{"name":"@arkwell","title":"Member - 405070001356275712","userid":"405070001356275712","url":"https://discord.com/users/405070001356275712","image_url":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif","imageURL":"https://cdn.discordapp.com/avatars/405070001356275712/a_dc76e5bb817c9ec73319c6fbfb3ccae7.gif"},"tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Serverinfo command","permalink":"/wikis/posts/405070001356275712/6bdeo"},"nextItem":{"title":"Unicode character unescape","permalink":"/wikis/posts/591690683509768223/0k0txb"}},"content":"```js\\nmodule.exports = [{\\n    name: \\"botinfo\\",\\n    code: `\\n$addField[Uptime;$uptime[full]]\\n$addField[Ping;$pingms]\\n$addField[Channels;$allChannelsCount]\\n$addField[Users;$allMembersCount]\\n$addField[Servers;$guildCount]\\n$title[Bot Information]\\n  `\\n}]; \\n```"},{"id":"/posts/591690683509768223/0k0txb","metadata":{"permalink":"/wikis/posts/591690683509768223/0k0txb","source":"@site/forums/posts/591690683509768223/0k0txb.md","title":"Unicode character unescape","description":"This custom function allows you to unescape unicode characters. For example, if you had this string (which is escaped): `Hey there, wassup?`, then by using this function, you would get `Hey there, wassup?`.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@artemcurious","title":"Member - 591690683509768223","userid":"591690683509768223","url":"https://discord.com/users/591690683509768223","image_url":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png","imageURL":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png"}],"frontMatter":{"title":"Unicode character unescape","description":"This custom function allows you to unescape unicode characters. For example, if you had this string (which is escaped): `Hey there, wassup?`, then by using this function, you would get `Hey there, wassup?`.","authors":{"name":"@artemcurious","title":"Member - 591690683509768223","userid":"591690683509768223","url":"https://discord.com/users/591690683509768223","image_url":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png","imageURL":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png"},"tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Botinfo command","permalink":"/wikis/posts/405070001356275712/sr2wtw"},"nextItem":{"title":"New if in old if commands","permalink":"/wikis/posts/591690683509768223/82om08"}},"content":"Hey there! This custom function allows you to unescape unicode characters. For example, if you had this string (which is escaped): `\\\\u0048\\\\u0065\\\\u0079\\\\u0020\\\\u0074\\\\u0068\\\\u0065\\\\u0072\\\\u0065\\\\u002C\\\\u0020\\\\u0077\\\\u0061\\\\u0073\\\\u0073\\\\u0075\\\\u0070\\\\u003F`, then by using this function, you would get `Hey there, wassup?`.\\n\\n### Example\\n![Example image](https://cdn.discordapp.com/attachments/1097056108440457356/1121460979453132851/image.png)\\nFairly simple usage, code, and meaning.\\n\\n\\nPaste the following code into your main file, common to be named `index.js`:\\n```js\\nbot.functionManager.createFunction({\\n  name: `$unicodeUnescape`,\\n  type: `djs`,\\n  code: async d => {\\n    const data = d.util.aoiFunc(d);\\n    function unicodeDecode(str) {\\n      return str.replace(/\\\\\\\\u([\\\\dA-Fa-f]{4})/g, (match, p1) => String.fromCharCode(parseInt(p1, 16)));\\n    }\\n    const [text] = data.inside.splits;\\n\\n    const unescapedString = unicodeDecode(text);\\n    data.result = unescapedString;\\n\\n    return {\\n      code: d.util.setCode(data)\\n    };\\n  }\\n});\\n```\\n\\nThat\'s it, have fun. Bye!"},{"id":"/posts/591690683509768223/82om08","metadata":{"permalink":"/wikis/posts/591690683509768223/82om08","source":"@site/forums/posts/591690683509768223/82om08.md","title":"New if in old if commands","description":"This code allows you to use the new `$if` in old `$if` commands","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@artemcurious","title":"Member - 591690683509768223","userid":"591690683509768223","url":"https://discord.com/users/591690683509768223","image_url":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png","imageURL":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png"}],"frontMatter":{"title":"New if in old if commands","description":"This code allows you to use the new `$if` in old `$if` commands","authors":{"name":"@artemcurious","title":"Member - 591690683509768223","userid":"591690683509768223","url":"https://discord.com/users/591690683509768223","image_url":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png","imageURL":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png"},"tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Unicode character unescape","permalink":"/wikis/posts/591690683509768223/0k0txb"},"nextItem":{"title":"Is file empty function","permalink":"/wikis/posts/591690683509768223/d0m8v5"}},"content":"This code allows you to use the new `$if` in old `$if` commands!\\nThis can be really useful in some cases.\\n\\n\\n\\nThis code creates a new function, called `$ifv6` that will act as the new `$if` anywhere you run it!\\nSo, if you have a command with old if enabled:\\n```js\\n  bot.command({\\n    name: `hi`,\\n    $if: \\"old\\",\\n    code: `hello $reply\\n$if[a==a]\\na does equal a!\\n$else\\na does not equal a, we\'re in a different dimension...\\n$endif\\n\\n$ifv6[b==b;b equals b!;b equals something other than b]`\\n  });\\n```\\nWe can use the new `$if` in an old `$if` command!\\n\\n### The code\\n```js\\nbot.functionManager.createFunction({\\n  name: \\"$ifv6\\",\\n  type: \\"djs\\",\\n  code: async d => bot.functionManager.cache.get(\\"if\\").code(d)\\n})\\n```\\n\\nBeing fairly simple, it uses the new `$if` through aoi.js\' code.\\nThat\'s it, enjoy coding your bot!"},{"id":"/posts/591690683509768223/d0m8v5","metadata":{"permalink":"/wikis/posts/591690683509768223/d0m8v5","source":"@site/forums/posts/591690683509768223/d0m8v5.md","title":"Is file empty function","description":"This function will return `true` or `false` based on whether the file specified is empty or not.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"},{"label":"v6","permalink":"/wikis/tags/v-6"}],"hasTruncateMarker":false,"authors":[{"name":"@artemcurious","title":"Member - 591690683509768223","userid":"591690683509768223","url":"https://discord.com/users/591690683509768223","image_url":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png","imageURL":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png"}],"frontMatter":{"title":"Is file empty function","description":"This function will return `true` or `false` based on whether the file specified is empty or not.","authors":{"name":"@artemcurious","title":"Member - 591690683509768223","userid":"591690683509768223","url":"https://discord.com/users/591690683509768223","image_url":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png","imageURL":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png"},"tags":["aoi.js","v6"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"New if in old if commands","permalink":"/wikis/posts/591690683509768223/82om08"},"nextItem":{"title":"Download function","permalink":"/wikis/posts/591690683509768223/h3mscp"}},"content":"This is a fairly simple function that will return `true` or `false` based on whether the file specified is empty or not.\\n\\n\\n\\nPaste this into your main file, common to be named `index.js`:\\n```js\\nbot.functionManager.createFunction({\\n  name: `$isFileEmpty`,\\n  type: \\"djs\\",\\n  code: async d => {\\n    const data = d.util.aoiFunc(d);\\n    const [filePath] = data.inside.splits;\\n\\n    const isFileEmpty = filePath => {\\n      try {\\n        const stats = fs.statSync(filePath);\\n        return stats.size === 0;\\n      } catch (error) {\\n        // Handle file not found or other errors\\n        console.error(\'Error:\', error);\\n        return false;\\n      }\\n    }\\n\\n    data.result = isFileEmpty(filePath);\\n\\n    return {\\n      code: d.util.setCode(data)\\n    };\\n  }\\n});\\n```\\n\\nThat\'s it, have fun, bye!"},{"id":"/posts/591690683509768223/h3mscp","metadata":{"permalink":"/wikis/posts/591690683509768223/h3mscp","source":"@site/forums/posts/591690683509768223/h3mscp.md","title":"Download function","description":"This is a custom function for downloading files accessible through https.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"},{"label":"v6","permalink":"/wikis/tags/v-6"}],"hasTruncateMarker":false,"authors":[{"name":"@artemcurious","title":"Member - 591690683509768223","userid":"591690683509768223","url":"https://discord.com/users/591690683509768223","image_url":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png","imageURL":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png"}],"frontMatter":{"title":"Download function","description":"This is a custom function for downloading files accessible through https.","authors":{"name":"@artemcurious","title":"Member - 591690683509768223","userid":"591690683509768223","url":"https://discord.com/users/591690683509768223","image_url":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png","imageURL":"https://cdn.discordapp.com/avatars/591690683509768223/e193473ac4cbcdecf90fc00826f1175e.png"},"tags":["aoi.js","v6"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Is file empty function","permalink":"/wikis/posts/591690683509768223/d0m8v5"},"nextItem":{"title":"Yes or no command","permalink":"/wikis/posts/632607624742961153/0s8eh9"}},"content":"Hey there! Ever needed to download an image, an audio file, or basically any type of file from the internet? Here\'s the command to solve your issue!\\n\\nPaste the following code into your bot\'s main file, which is usually `index.js`:\\n\\n\\n\\n```\\nconst url = require(\'url\');\\n\\nbot.functionManager.createFunction({\\n  name: \'$download\',\\n  type: \'djs\',\\n  code: async (d) => {\\n    const data = d.util.aoiFunc(d);\\n    let [urlValue, destinationPath] = data.inside.splits;\\n\\n    if (!destinationPath) {\\n      let parsedUrl = new URL(urlValue.replace(/#COLON#/g, \':\'));\\n      let pathname = parsedUrl.pathname;\\n      let filename = pathname.split(\'/\').pop();\\n      destinationPath = filename;\\n    }\\n\\n    let unescapedURL = urlValue\\n      .replace(/#LEFT#/g, \']\')\\n      .replace(/#SEMI#/g, \';\')\\n      .replace(/#COLON#/g, \':\')\\n      .replace(/#CHAR#/g, \'$\')\\n      .replace(/#RIGHT_CLICK#/g, \'<\')\\n      .replace(/#LEFT_CLICK#/g, \'>\')\\n      .replace(/#EQUAL#/g, \'=\')\\n      .replace(/#RIGHT_BRACKET#/g, \'{\')\\n      .replace(/#LEFT_BRACKET#/g, \'}\')\\n      .replace(/#COMMA#/g, \',\')\\n      .replace(/#AND#/g, \'&&\');\\n\\n    function download() {\\n      const https = require(\'https\');\\n      const fs = require(\'fs\');\\n\\n      const file = fs.createWriteStream(destinationPath);\\n\\n      https.get(unescapedURL, (response) => {\\n        response.pipe(file);\\n      });\\n    }\\n\\n    if (!urlValue) return d.aoiError.fnError(d, \'custom\', {}, \'The parameter \\"url\\" does not have any arguments!\');\\n\\n    data.result = download();\\n    return {\\n      code: d.util.setCode(data),\\n    };\\n  },\\n});\\n```\\n\\nAfter that is done, you can call the function by doing `$download` with the URL and filepath parameters like so:\\n`$download[https://cdn.discordapp.com/icons/773352845738115102/a_fa8ffe5e43202d2974e8484548d4662c.gif;./aoijs.gif]`\\n\\nThat\'s it!\\n\\n### How does it work?\\nIt uses the `https` module to download the file you requested. Please note that any files accessible only through the `http` protocol can\'t be downloaded!\\n\\n### Improvements\\nRecently, I made some improvements to the code, so it\'s different to the old $download function I made.\\nThe changes are:\\n- it will now automatically unescape characters and makes it so that there is no need of using $nonEscape\\n- it will now auto-generate a destination path from the file\'s link if you didn\'t specify the parameter. For example, if you only specified the URL, but no destination path, like over here: `$download[https://cdn.discordapp.com/icons/773352845738115102/a_fa8ffe5e43202d2974e8484548d4662c.gif]`, then it will just download the file with the name `a_fa8ffe5e43202d2974e8484548d4662c.gif` and to the root directory of your project\\n- if the `url` parameter is not specified, then it will now return a proper error\\n\\nHave fun coding your aoi.js bot!"},{"id":"/posts/632607624742961153/0s8eh9","metadata":{"permalink":"/wikis/posts/632607624742961153/0s8eh9","source":"@site/forums/posts/632607624742961153/0s8eh9.md","title":"Yes or no command","description":"Yes or no command","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"},{"label":"v6","permalink":"/wikis/tags/v-6"}],"hasTruncateMarker":false,"authors":[{"name":"@dodogames","title":"Member - 632607624742961153","userid":"632607624742961153","url":"https://discord.com/users/632607624742961153","image_url":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png","imageURL":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png"}],"frontMatter":{"title":"Yes or no command","description":"Yes or no command","authors":{"name":"@dodogames","title":"Member - 632607624742961153","userid":"632607624742961153","url":"https://discord.com/users/632607624742961153","image_url":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png","imageURL":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png"},"tags":["aoi.js","v6"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Download function","permalink":"/wikis/posts/591690683509768223/h3mscp"},"nextItem":{"title":"HowGamer command","permalink":"/wikis/posts/632607624742961153/ic9vu7"}},"content":"Most ridiculous command (in my opinion) made for fun purposes.\\n\\n\\n\\n```js\\nmodule.exports = {\\nname: \\"yesorno\\",\\ncode: `> $message\\n*$randomText[yes;no]*\\n$cooldown[5s; Slow down! Don\'t spam the command!\\nTime left: \\\\`%time%\\\\`]\\n$onlyIf[$message!=;Please Ask me a question to answer you.]`\\n}\\n```"},{"id":"/posts/632607624742961153/ic9vu7","metadata":{"permalink":"/wikis/posts/632607624742961153/ic9vu7","source":"@site/forums/posts/632607624742961153/ic9vu7.md","title":"HowGamer command","description":"Checks how gamer you\'re for no reason, It\'s just for fun so.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@dodogames","title":"Member - 632607624742961153","userid":"632607624742961153","url":"https://discord.com/users/632607624742961153","image_url":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png","imageURL":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png"}],"frontMatter":{"title":"HowGamer command","description":"Checks how gamer you\'re for no reason, It\'s just for fun so.","authors":{"name":"@dodogames","title":"Member - 632607624742961153","userid":"632607624742961153","url":"https://discord.com/users/632607624742961153","image_url":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png","imageURL":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png"},"tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Yes or no command","permalink":"/wikis/posts/632607624742961153/0s8eh9"},"nextItem":{"title":"Long Serverinfo command","permalink":"/wikis/posts/632607624742961153/iiwq2"}},"content":"```js\\nmodule.exports = {\\nname: \\"howgamer\\",\\ncode: `$title[how Gamer machine]\\n$description[$username[$mentioned[1;true]] is $random[1;100]% Gamer]\\n$color[Random]\\n$onlyIf[$mentioned[1;true]!=$authorID;{newEmbed:{title:how Gamer machine}{description:you\'re $random[1;100]% Gamer}{color:Random}}]\\n$cooldown[5s; Slow down! Don\'t spam the command!\\nTime left: \\\\`%time%\\\\`]\\n`\\n}\\n```"},{"id":"/posts/632607624742961153/iiwq2","metadata":{"permalink":"/wikis/posts/632607624742961153/iiwq2","source":"@site/forums/posts/632607624742961153/iiwq2.md","title":"Long Serverinfo command","description":"A long serverinfo command just for you. Nothing fancy about it.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@dodogames","title":"Member - 632607624742961153","userid":"632607624742961153","url":"https://discord.com/users/632607624742961153","image_url":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png","imageURL":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png"}],"frontMatter":{"title":"Long Serverinfo command","description":"A long serverinfo command just for you. Nothing fancy about it.","authors":{"name":"@dodogames","title":"Member - 632607624742961153","userid":"632607624742961153","url":"https://discord.com/users/632607624742961153","image_url":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png","imageURL":"https://cdn.discordapp.com/avatars/632607624742961153/5a4dc9bcccf66c5372f410c40d267708.png"},"tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"HowGamer command","permalink":"/wikis/posts/632607624742961153/ic9vu7"},"nextItem":{"title":"anti swear command","permalink":"/wikis/posts/715852000096419900/cy1ltq"}},"content":"```js\\nmodule.exports = {\\n  name: \\"serverinfo\\",\\n  aliases: \\"server\\",\\n  code: `$title[Server Info]\\n  $addField[Verification Level;$get[verifylevel]]\\n  $addField[Other;\\nServer Created since: $creationDate[$guildID;date]\\nContent Filter: $get[content]\\nServer ID: $guildID\\n]\\n  $addField[General;\\nRoles: $roleCount[$guildID;true]\\nEmojis: $emojiCount[$guildID] \\nServer Boosts: $guildBoostCount[$guildID]\\n\\n]\\n  $addField[Channels;\\nTotal: $channelCount[$guildID;all]\\nText Channels: $channelCount[$guildID;Text]\\nVoice Channels: $channelCount[$guildID;Voice]\\nAnnouncement Channels: $channelCount[$guildID;Announcement]\\nForum Channels: $channelCount[$guildID;Forum]\\nCategories: $channelCount[$guildID;Category]\\n]\\n  $addField[Members information;\\nTotal: $membersCount[$guildID;all;true]\\nHumans: $membersCount[$guildID;all;false]\\nBots: $botCount[$guildID]\\n]\\n  $thumbnail[$get[serverimage]]\\n  $cooldown[5s; Slow down! Don\'t spam the command!\\nTime left: \\\\`%time%\\\\`]\\n  \\n  $let[verifylevel;$replaceText[$replaceText[$replaceText[$replaceText[$GuildVerificationLevel;1;Low];2;Medium];3;High];4;Very High]]\\n  $let[content;$replaceText[$replaceText[$replaceText[$guildContentFilter[$guildID];0;Disabled];1;Medium];2;High]]\\n  $let[serverimage;$replaceText[$replaceText[$checkCondition[$guildIcon==];false;$guildIcon];true;$userAvatar[$clientID]]]\\n`\\n}\\n```\\n# Note\\nThis command requires the intent `GuildPresences` to be added into your bot\'s main file (aka index.js) for the total members shown to be correct. If this doesn\'t work then eval `$cacheMembers[$guildID]` in the server where you used serverinfo command (while having the intent added as well) and then try again. Feel free to ask for help in support if needed!"},{"id":"/posts/715852000096419900/cy1ltq","metadata":{"permalink":"/wikis/posts/715852000096419900/cy1ltq","source":"@site/forums/posts/715852000096419900/cy1ltq.md","title":"anti swear command","description":"A djs code to check if any message contains swear words or not.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"Other","permalink":"/wikis/tags/other"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@ahoemi","title":"Member - 715852000096419900","userid":"715852000096419900","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"}],"frontMatter":{"title":"anti swear command","description":"A djs code to check if any message contains swear words or not.","authors":{"name":"@ahoemi","title":"Member - 715852000096419900","userid":"715852000096419900","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"},"tags":["v6","Other","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Long Serverinfo command","permalink":"/wikis/posts/632607624742961153/iiwq2"},"nextItem":{"title":"toToggleCase","permalink":"/wikis/posts/715852000096419900/dmrmlh"}},"content":"```js\\nmodule.exports = {\\nname: \\"$alwaysExecute\\",\\ncode: `\\n$deleteCommand\\n<@$authorID> Please refrain from swearing!\\n\\n$onlyIf[$djsEval[const BadWordsNext = require(\'bad-words-next\')\\nconst en = require(\'bad-words-next/data/en.json\')\\nconst badwords = new BadWordsNext({ data: en })\\nbadwords.check(\\\\`$message\\\\`);true]==true]\\n\\n$onlyIf[$checkCondition[$message!=||$isBot[$authorID]==false]==true;]\\n\\n$suppressErrors\\n`\\n}\\n```\\n\\n### Error?\\nprobably modules not found\\n- go to shell/terminal and type `npm i bad-words-next`\\n\\n### Good Luck"},{"id":"/posts/715852000096419900/dmrmlh","metadata":{"permalink":"/wikis/posts/715852000096419900/dmrmlh","source":"@site/forums/posts/715852000096419900/dmrmlh.md","title":"toToggleCase","description":"A custom d.js function for text modification.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"Other","permalink":"/wikis/tags/other"}],"hasTruncateMarker":false,"authors":[{"name":"@ahoemi","title":"Member - 715852000096419900","userid":"715852000096419900","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"}],"frontMatter":{"title":"toToggleCase","description":"A custom d.js function for text modification.","authors":{"name":"@ahoemi","title":"Member - 715852000096419900","userid":"715852000096419900","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"},"tags":["v6","Other"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"anti swear command","permalink":"/wikis/posts/715852000096419900/cy1ltq"},"nextItem":{"title":"Colored and styled console logging","permalink":"/wikis/posts/715852000096419900/sof89f"}},"content":"```js\\nbot.functionManager.createFunction({\\n  name: \\"$toToggleCase\\",\\n  type: \\"djs\\",\\n  code: (d) => {\\n const data = d.util.aoiFunc(d);\\nif (data.err) return d.error(data.err);\\n const [ texts ] = data.inside.splits\\nconst output = texts\\n      .split(\\" \\")\\n      .map(\\n        (text) =>\\n          text.addBrackets().slice(0, 1).toLowerCase() + text.addBrackets().slice(1).toUpperCase(),\\n        ).join(\\" \\");\\n\\ndata.result = output\\n    return {\\n        code: d.util.setCode(data),\\n    };\\n}\\n})\\n```\\n## Usage\\n`$toToggleCase[This Is useless fr]`   \\nThis will result in `tHIS iS uSELESS fR`\\n\\n![image](https://media.discordapp.net/attachments/902553397281030208/1120917182365306981/image0.jpg)\\n\\n## Where to use this code?\\nPlace this in your bottom of main file aka index.js"},{"id":"/posts/715852000096419900/sof89f","metadata":{"permalink":"/wikis/posts/715852000096419900/sof89f","source":"@site/forums/posts/715852000096419900/sof89f.md","title":"Colored and styled console logging","description":"List of codes for colored and styled console logging.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"Other","permalink":"/wikis/tags/other"}],"hasTruncateMarker":false,"authors":[{"name":"@ahoemi","title":"Member - 715852000096419900","userid":"715852000096419900","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"}],"frontMatter":{"title":"Colored and styled console logging","description":"List of codes for colored and styled console logging.","authors":{"name":"@ahoemi","title":"Member - 715852000096419900","userid":"715852000096419900","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"},"tags":["v6","Other"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"toToggleCase","permalink":"/wikis/posts/715852000096419900/dmrmlh"},"nextItem":{"title":"reverseText","permalink":"/wikis/posts/715852000096419900/w2htzj"}},"content":"List of codes for colored and styled console logging.\\n\\n# List of codes\\n### Color\\n- Black: `\\\\\\\\u001b\\\\\\\\[30mThis is black text\\\\\\\\u001b\\\\\\\\[0m`\\n- Red: `\\\\\\\\u001b\\\\\\\\[31mThis is red text\\\\\\\\u001b\\\\\\\\[0m`\\n- Green: `\\\\\\\\u001b\\\\\\\\[32mThis is green text\\\\\\\\u001b\\\\\\\\[0m`\\n- Yellow: `\\\\\\\\u001b\\\\\\\\[33mThis is yellow text\\\\\\\\u001b\\\\\\\\[0m`\\n- Blue: `\\\\\\\\u001b\\\\\\\\[34mThis is blue text\\\\\\\\u001b\\\\\\\\[0m`\\n- Magenta: `\\\\\\\\u001b\\\\\\\\[35mThis is magenta text\\\\\\\\u001b\\\\\\\\[0m`\\n- Cyan: `\\\\\\\\u001b\\\\\\\\[36mThis is cyan text\\\\\\\\u001b\\\\\\\\[0m`\\n- White: `\\\\\\\\u001b\\\\\\\\[37mThis is white text\\\\\\\\u001b\\\\\\\\[0m`\\n- Dark Gray: `\\\\\\\\u001b\\\\\\\\[30mThis is dark gray text\\\\\\\\u001b\\\\\\\\[0m`\\n- Bright Gray: `\\\\\\\\u001b\\\\\\\\[37mThis is bright gray text\\\\\\\\u001b\\\\\\\\[0m`\\n- Bright Red: `\\\\\\\\u001b\\\\\\\\[91mThis is bright red text\\\\\\\\u001b\\\\\\\\[0m`\\n- Bright Green: `\\\\\\\\u001b\\\\\\\\[92mThis is bright green text\\\\\\\\u001b\\\\\\\\[0m`\\n- Bright Yellow: `\\\\\\\\u001b\\\\\\\\[93mThis is bright yellow text\\\\\\\\u001b\\\\\\\\[0m`\\n- Bright Blue: `\\\\\\\\u001b\\\\\\\\[94mThis is bright blue text\\\\\\\\u001b\\\\\\\\[0m`\\n- Bright Magenta: `\\\\\\\\u001b\\\\\\\\[95mThis is bright magenta text\\\\\\\\u001b\\\\\\\\[0m`\\n- Bright Cyan: `\\\\\\\\u001b\\\\\\\\[96mThis is bright cyan text\\\\\\\\u001b\\\\\\\\[0m`\\n\\n### Style\\n- Bold: `\\\\\\\\u001b\\\\\\\\[1mThis is bold text\\\\\\\\u001b\\\\\\\\[0m`\\n- Dim: `\\\\\\\\u001b\\\\\\\\[2mThis is dim text\\\\\\\\u001b\\\\\\\\[0m`\\n- Underline: `\\\\\\\\u001b\\\\\\\\[4mThis is underlined text\\\\\\\\u001b\\\\\\\\[0m`\\n- Hidden: `\\\\\\\\u001b\\\\\\\\[8m This is hidden text\\\\\\\\u001b\\\\\\\\[0m`\\n- Italic: `\\\\\\\\u001b\\\\\\\\[3mItalic text\\\\\\\\u001b\\\\\\\\[0m`\\n- Strikethrough: `\\\\\\\\u001b\\\\\\\\[9mStrikethrough text\\\\\\\\u001b\\\\\\\\[0m`\\n\\n### Background\\n- `\\\\\\\\u001b\\\\\\\\[7mThis is white background text\\\\\\\\u001b\\\\\\\\[0m`\\n\\n## Usage\\n```js\\n$djsEval[console.log(\\"\\\\\\\\u001b\\\\\\\\[7mThis is white background text\\\\\\\\u001b\\\\\\\\[0m\\")]\\n```\\n#### Color might change depending of host and platform\\n\\n![colored](https://media.discordapp.net/attachments/902553397281030208/1122012102270390292/image0.jpg?raw=true)\\n\\n#### Part 2 will also be there"},{"id":"/posts/715852000096419900/w2htzj","metadata":{"permalink":"/wikis/posts/715852000096419900/w2htzj","source":"@site/forums/posts/715852000096419900/w2htzj.md","title":"reverseText","description":"A fun command to modify text and reverse them.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"Other","permalink":"/wikis/tags/other"}],"hasTruncateMarker":false,"authors":[{"name":"@ahoemi","title":"Member - 715852000096419900","userid":"715852000096419900","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"}],"frontMatter":{"title":"reverseText","description":"A fun command to modify text and reverse them.","authors":{"name":"@ahoemi","title":"Member - 715852000096419900","userid":"715852000096419900","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"},"tags":["v6","Other"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Colored and styled console logging","permalink":"/wikis/posts/715852000096419900/sof89f"},"nextItem":{"title":"randomText advanced","permalink":"/wikis/posts/715852000096419900/xzyzwx"}},"content":"```js\\n$djsEval[let texts = \\"PUT YOUR TEXT HERE\\"\\nlet parts = texts.split(\'\');\\nlet output = \'\';\\nfor (let i = parts.length - 1; i >= 0; i--) {\\n  output += parts[i];\\n}\\noutput;true]\\n```\\n## Usage\\nPut your text in the code and the result will be reversed text of your input.\\n\\n![reverseText](https://media.discordapp.net/attachments/1022533781040672839/1121226275374239784/image0.jpg?raw=true)\\n\\n### Where to use this?\\nI made it in `$djsEval` so u can use it anywhere inside your code \\n\\n-I know right its has no actual uses, but might be for fun bots-"},{"id":"/posts/715852000096419900/xzyzwx","metadata":{"permalink":"/wikis/posts/715852000096419900/xzyzwx","source":"@site/forums/posts/715852000096419900/xzyzwx.md","title":"randomText advanced","description":"A custom function to get random/specified number of words.","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"Other","permalink":"/wikis/tags/other"}],"hasTruncateMarker":false,"authors":[{"name":"@ahoemi","title":"Member - 715852000096419900","userid":"715852000096419900","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"}],"frontMatter":{"title":"randomText advanced","description":"A custom function to get random/specified number of words.","authors":{"name":"@ahoemi","title":"Member - 715852000096419900","userid":"715852000096419900","url":"https://discord.com/users/715852000096419900","image_url":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png","imageURL":"https://cdn.discordapp.com/avatars/715852000096419900/4dd9ab5b17ca6c07e4da71746cd0eca9.png"},"tags":["v6","Other"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"reverseText","permalink":"/wikis/posts/715852000096419900/w2htzj"},"nextItem":{"title":"Ticketing system","permalink":"/wikis/posts/949588732498018324/r4uv0q"}},"content":"```js\\nbot.functionManager.createFunction({\\n  name: \\"$randomWord\\",\\n  type: \\"djs\\",\\n  code: async (d) => {\\n  const functionName = \\"$randomWord\\";\\n  const data = d.util.aoiFunc(d);\\n  const [ words, numb = 1 ] = data.inside.splits;\\n\\nif (!words || words === \\"\\") {\\n let error = `\\\\`\\\\`\\\\`elixir\\\\nRei.js Error\\\\n${functionName}: Words were not provided!\\\\`\\\\`\\\\``\\n  data.result = error\\n} else {\\n  let wordArr = words.split(\':\');\\n  let num = numb > wordArr.length ? wordArr.length : numb;\\n  var randWords = [];\\n  for (let i = 0; i < num; i++) {\\n    let newRandom;\\n    do {\\n      let rand = Math.floor(Math.random() * wordArr.length);\\n      newRandom = wordArr[rand];\\n    } while (randWords.includes(newRandom));\\n    randWords.push(newRandom);\\n  }\\nconst output = randWords.join(\', \')\\ndata.result = output\\n}\\n    return {\\n      code: d.util.setCode(data),\\n    };\\n  }\\n})\\n```\\n### Usage \\n`$randomWord[Hi:Hello:Bye:Sayonara;2]`\\nwill return 2 random words from Hi, Hello, Bye and Sayonara\\n\\n### Where do i use it?\\n- Paste it at bottom of your main file.\\n- You can also edit it and use in handler\\nMention me in support server for any help."},{"id":"/posts/949588732498018324/r4uv0q","metadata":{"permalink":"/wikis/posts/949588732498018324/r4uv0q","source":"@site/forums/posts/949588732498018324/r4uv0q.md","title":"Ticketing system","description":"This is a ticketing system whose most of the codes are aoi.js while some, like the transcript is made with discord.js. I thought of making this wiki as many people are having doubts or want to make a ticketing system. ","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"},{"label":"v6","permalink":"/wikis/tags/v-6"}],"hasTruncateMarker":false,"authors":[{"name":"@nanotechpikachu","title":"Member - 949588732498018324","userid":"949588732498018324","url":"https://discord.com/users/949588732498018324","image_url":"https://cdn.discordapp.com/avatars/949588732498018324/e8daecdc63c0c4faa5e11c8b1967acc9.png","imageURL":"https://cdn.discordapp.com/avatars/949588732498018324/e8daecdc63c0c4faa5e11c8b1967acc9.png"}],"frontMatter":{"title":"Ticketing system","description":"This is a ticketing system whose most of the codes are aoi.js while some, like the transcript is made with discord.js. I thought of making this wiki as many people are having doubts or want to make a ticketing system. ","authors":{"name":"@nanotechpikachu","title":"Member - 949588732498018324","userid":"949588732498018324","url":"https://discord.com/users/949588732498018324","image_url":"https://cdn.discordapp.com/avatars/949588732498018324/e8daecdc63c0c4faa5e11c8b1967acc9.png","imageURL":"https://cdn.discordapp.com/avatars/949588732498018324/e8daecdc63c0c4faa5e11c8b1967acc9.png"},"tags":["aoi.js","v6"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"randomText advanced","permalink":"/wikis/posts/715852000096419900/xzyzwx"},"nextItem":{"title":"Roblox group info command","permalink":"/wikis/posts/964024743172915220/ebigj"}},"content":"This is a ticketing system whose most of the codes are aoi.js while some, like the transcript is made with discord.js. I thought of making this wiki as many people are having doubts or want to make a ticketing system.\\n\\n## Getting started\\nI will start with some prerequisites which if you have would be splendid!\\n- Knowledge about aoi js and how it works. (A stage between beginning - intermediate would be good even if you aren\'t, it\'s ok.)\\n- Discord.js Knowledge (not necessary)\\n\\nI will also include my version for which I have tried the code and it worked perfectly fine.\\n- Aoi Version: 6.2.6\\n- NodeJS Version: 18.16.0\\n\\nSo in this wiki, I will give you the ticketing system code with functions like transcript (html), auto transcript etc. This is primarily made with Aoi while some of them like transcript uses discord.js codes.\\n\\n## Installations needed\\nThe following libraries/modules are needed:\\n- `npm i aoi.js` (AOI)\\n- `npm i aoi.parser` (AOI Parser)\\n- `npm i discord.js` (Discord.js)\\n- `npm i discord-html-transcripts` (Transcript)\\n\\n## Variables folder\\nPlease put the following vars in your `variables.js` file.\\n```js\\ntick_e: \\"false\\",\\ntick_r: \\"\\",\\ntick: \\"false\\",\\ntick_c: \\"0\\",\\ntranscript_channel: \\"$channelID\\",\\ntick_describe: \\"Hey, this is your ticket. Support will arrive shortly.\\",\\npanel_title: \\"Open a ticket\\",\\nticket_title: \\"Ticket\\",\\npanel_desc: \\"Click the button to open a ticket!\\",\\nbutton_name: \\"Open ticket\\",\\nch_name: \\"tick\\",\\nauto_tran: \\"false\\"\\n```\\n\\n## Notes and References\\nYou can refer the aoi docs for information regarding the functions and how to use them also the support server for help. \\n\\nThis code is made with reference to the **old Discord Username** like `NanotechPikachu#6406` and hence, `$userTag` is used. With the outbreak of the **new Username** like `@nanotechpikachu`, the `$userTag` function will show `nanotechpikachu#0` so, you can use `$username` in places where I have used `$userTag`.\\n\\nAlso, you can edit the `close` button to not delete the channel but, revoke the access of the ticket owner. Much more by using your imagination can be done.\\n\\n**Note:** *When I was copying my code from my host, there is a chance that some errors might be there in the github gist link I attached. If you encounter any errors which affects it\'s functionality, please do say so that I can rectify them.*\\n\\n## Code\\nI won\'t waste time and will share the code. Since the code is too long, I will attach my GitHub gist link.\\n\\nCode: https://gist.github.com/NanotechPikachu/1e3f8254ec4643ed279a478490896020\\n\\n**Note:** The images are for reference purposes only and the title, description, etc will *vary as per the value of vars!*\\n\\n## Credits\\nThe code\'s credit majorly belongs to me but still, I have to give credits to some people and they are:\\n- The person(s) whom I took inspiration to create this code. As I don\'t know their name, I won\'t comment.\\n- Fafa (for helping me with transcript code.)\\n- The wonderful staff and support team of Aoi support server who helped me with the bugs of my code.\\n- Last but no the least, to my fellow coders.\\n\\n## Contact me\\nIf you encounter any problems or have any doubt, feel free to contact me and ask it out. I will reply and try to clear your doubts as soon as I can. You can reply to this wiki or Discord me.\\nDiscord(new username) - @nanotechpikachu\\n\\nThanks for reading and have a wonderful coding journey ahead!"},{"id":"/posts/964024743172915220/ebigj","metadata":{"permalink":"/wikis/posts/964024743172915220/ebigj","source":"@site/forums/posts/964024743172915220/ebigj.md","title":"Roblox group info command","description":"Displays info about a roblox group","date":"2023-06-24T20:24:29.000Z","formattedDate":"June 24, 2023","tags":[{"label":"v6","permalink":"/wikis/tags/v-6"},{"label":"aoi.js","permalink":"/wikis/tags/aoi-js"}],"hasTruncateMarker":false,"authors":[{"name":"@supremesupreme","title":"Member - 964024743172915220","userid":"964024743172915220","url":"https://discord.com/users/964024743172915220","image_url":"https://cdn.discordapp.com/avatars/964024743172915220/a_153765879b794acfd5fd72ce3f6cd713.gif","imageURL":"https://cdn.discordapp.com/avatars/964024743172915220/a_153765879b794acfd5fd72ce3f6cd713.gif"}],"frontMatter":{"title":"Roblox group info command","description":"Displays info about a roblox group","authors":{"name":"@supremesupreme","title":"Member - 964024743172915220","userid":"964024743172915220","url":"https://discord.com/users/964024743172915220","image_url":"https://cdn.discordapp.com/avatars/964024743172915220/a_153765879b794acfd5fd72ce3f6cd713.gif","imageURL":"https://cdn.discordapp.com/avatars/964024743172915220/a_153765879b794acfd5fd72ce3f6cd713.gif"},"tags":["v6","aoi.js"],"hide_table_of_contents":false,"enableComments":true,"pagination_prev":null,"pagination_next":null},"prevItem":{"title":"Ticketing system","permalink":"/wikis/posts/949588732498018324/r4uv0q"}},"content":"```js\\nmodule.exports = {\\n    name: \\"groupinfo\\",\\n    code: `\\n    $title[1;Success!] \\n    $description[> Group ID: $getobjectproperty[id]\\n    > **Group Name:** $getobjectproperty[name]\\n    > **Group Description:** $getobjectproperty[description] $if[$getobjectproperty[description]==;undefined;]\\n    > **Group OwnerId:** $getobjectproperty[owner.username]\\n    > **Group Latest Shout:** $getobjectproperty[shout.body] $if[$getobjectproperty[shout.body]==;undefined;]\\n]\\n    $color[1;#C3A78E]\\n    $footer[1;bob]\\n    $createObject[$jsonRequest[https://groups.roblox.com/v1/groups/$message[1]]]\\n    $argscheck[1;Group id?]\\n    `\\n}\\n```"}]}')}}]);